  <style>
    body {
      max-width: 600px;
      margin: 10px auto
    }

    .map {
      position: relative;
      padding-bottom: 147%;
      overflow: hidden;
      border: 5px solid hotpink;
      background: #b6eeff;
    }

    .map svg {
      position: absolute;
      height: 100%;
      width: 100%;
      transition: transform 0.33s;
      will-change: transform;
      transform-origin: center;
    }

    .inner {
      transition: transform 0.33s;
      will-change: transform;
      position: absolute;
      height: 100%;
      width: 100%;
    }

    .zoomed .inner{
      transform: scale(3);
    }

    #layer1 path:hover {
      fill:black!important;
      cursor: pointer;
    }

    .highlight {
      fill: black!important;
    }

    .zoom {
      position: absolute;
      top: 10px;
      left: 10px;
      z-index: 10
    }

    .zoom a {
      padding: 10px;
      color: white;
      background: black;
      text-decoration: none;
      display: block;
      margin: 1px;
    }

    .zoom a + a {
      top: 50%;
    }
  </style>
</head>

  <script>
    var layers = document.querySelectorAll('#layer1 path');
    var map = document.querySelector('.map');
    var svg = map.querySelector('svg');
    var zoomed = false;

    svg.currentX = 0;
    svg.currentY = 0;

    layers.forEach(function(layer){
      layer.onclick = function(event){
        highlight(this, layers)
        var dims = center(event.layerX - svg.currentX, event.layerY - svg.currentY);
        svg.style.cssText = "transform: translate(" + (dims[0]) + "px,"+ (dims[1]) +"px)";
        map.classList.add('zoomed');
        zoomed = true;
      }
    
    })

    function highlight(segment, segments){

      segments.forEach(function(item){
        item.classList.remove('highlight')
      })

      if(segment){
        segment.classList.add('highlight');
      }
    }

    function center(x, y){
      
      var w = map.getBoundingClientRect().width;
      var h = map.getBoundingClientRect().height;

      var woffset = (w/2) - x;
      var hoffset = (h/2) - y;

      svg.currentX = woffset;
      svg.currentY = hoffset;

      if(!zoomed){
        svg.currentX = woffset*3;
        svg.currentY = hoffset*3;
      }
    
      return [(zoomed ? woffset/(10/3) : woffset), (zoomed ? hoffset/(10/3) : hoffset)];
    }

    function zoom(direction){
      if(direction === 'out'){
        map.classList.remove('zoomed');
        zoomed = false;
        highlight(false, layers);
        svg.currentY = 0;
        svg.currentX = 0;
        svg.style.cssText = "";
      }

      if(direction === 'in'){
        map.classList.add('zoomed');
        zoomed = true;
      }
    }

    document.querySelector('[data-role="zoom-in"]').onclick = function(e){
      e.preventDefault();
      zoom('in');
    }

    document.querySelector('[data-role="zoom-out"]').onclick = function(e){
      e.preventDefault();
      zoom('out');
    }
  </script>
